Brain Games: Season 2

Health-Medical Documentary hosted by Jason Silva, published by National Geographic in 2013 - English narration


Information
------------------------------

Brain Games: Season 2
Get ready, because season two of Brain Games is about to blow your mind. Join host Jason Silva and deception specialist Apollo Robbins as they visit neuroscientists on the cutting edge of brain research, revealing all that we know-and all we have yet to learn- about what's really going on inside our brains. Twelve episodes are packed with interactive games and try-at-home experiments that will astonish and entertain you, while totally messing with your mind.






11)  What You Dont Know 
Brain Games reveals how the &quot;illusion of knowledge&quot; plagues the human brain and why we fall victim to the notion that we understand more than we actually do.

12)  Seeing is Believing 
Seeing is believing, right? Not necessarily. It all depends on your perspective. In this episode of Brain Games, mind-bending illusions will show you the ways in which your visual perceptions can be surprisingly off. Watch as your brain turns beautiful people into scary monsters, and reduces giants to miniatures.

